import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';

// Import your components
import Sidebar from './components/Sidebar';
import Dashboard from './pages/Dashboard';
import StudentSignUp from './components/StudentSignUp';
import StudentSignIn from './components/StudentSignIn';

// Placeholder components for routes we haven't built yet
const Events = () => <div style={{padding:'40px', marginLeft:'20px'}}><h1>Events Page</h1></div>;
const MyTickets = () => <div style={{padding:'40px', marginLeft:'20px'}}><h1>My Tickets Page</h1></div>;
const Profile = () => <div style={{padding:'40px', marginLeft:'20px'}}><h1>Profile Page</h1></div>;
const Settings = () => <div style={{padding:'40px', marginLeft:'20px'}}><h1>Settings Page</h1></div>;

const App = () => {
  // State to track if user is logged in
  const [user, setUser] = useState(null); 
  const [theme, setTheme] = useState('light'); // 'light' or 'dark'

  // Mock Event Data for Dashboard
  const [events] = useState([
    { id: 1, title: 'React Workshop', date: '12 Apr · 09:00 AM', location: 'Hall A', category: 'Tech', image: 'https://images.unsplash.com/photo-1633356122544-f134324a6cee?w=400' },
    { id: 2, title: 'Design Thinking', date: '15 Apr · 11:00 AM', location: 'Lab 2', category: 'Design', image: 'https://images.unsplash.com/photo-1561070791-2526d30994b5?w=400' },
    { id: 3, title: 'Career Fair', date: '20 Apr · 10:00 AM', location: 'Auditorium', category: 'Career', image: 'https://images.unsplash.com/photo-1544531586-fde5298cdd40?w=400' },
    { id: 4, title: 'AI Seminar', date: '22 Apr · 02:00 PM', location: 'Online', category: 'Tech', image: 'https://images.unsplash.com/photo-1620712943543-bcc4688e7485?w=400' },
  ]);

  // Login Handler
  const handleLogin = (userData) => {
    setUser({ 
      ...userData, 
      profileImage: 'https://images.unsplash.com/photo-1494790108377-be9c29b29330?w=100' // Mock image
    });
  };

  // Logout Handler
  const handleLogout = () => {
    setUser(null);
  };

  return (
    <Router>
      <div style={{ 
        display: 'flex', 
        backgroundColor: theme === 'dark' ? '#0f172a' : '#f8fafc', 
        minHeight: '100vh' 
      }}>
        
        {/* SHOW SIDEBAR ONLY IF LOGGED IN */}
        {user && (
          <Sidebar 
            user={user} 
            theme={theme} 
            onLogout={handleLogout} 
          />
        )}

        {/* MAIN CONTENT AREA */}
        {/* If logged in, add margin-left to push content past the sidebar */}
        <div style={{ 
          flex: 1, 
          // Matches the sidebar "collapsed" width (56px) plus a little gap if needed
          marginLeft: user ? '56px' : '0', 
          transition: 'margin-left 0.3s ease' 
        }}>
          
          <Routes>
            {/* PUBLIC ROUTES (No Sidebar) */}
            <Route path="/signup" element={<StudentSignUp onLogin={handleLogin} />} />
            <Route path="/signin" element={<StudentSignIn onLogin={handleLogin} />} />

            {/* PROTECTED ROUTES (Sidebar Visible) */}
            <Route 
              path="/" 
              element={ user ? (
                <Dashboard 
                  user={user} 
                  events={events} 
                  theme={theme} 
                  regCount={3} 
                  unreadCount={2} 
                  onReadNotifications={() => {}} 
                />
              ) : (
                <Navigate to="/signin" />
              )} 
            />
            
            <Route path="/events" element={user ? <Events /> : <Navigate to="/signin" />} />
            <Route path="/my-events" element={user ? <MyTickets /> : <Navigate to="/signin" />} />
            <Route path="/profile" element={user ? <Profile /> : <Navigate to="/signin" />} />
            <Route path="/settings" element={user ? <Settings /> : <Navigate to="/signin" />} />

          </Routes>
        </div>
      </div>
    </Router>
  );
};

export default App;
